1. 1 step + 1 step
2. 2 steps","Input: n = 3
Output: 3
Explanation: There are three ways to climb to the top.
1. 1 step + 1 step + 1 step
2. 1 step + 2 steps
3. 2 steps + 1 step"}', '{"<code>1 &lt;= n &lt;= 45</code>"}', '{Math,"Dynamic Programming",Memoization}', '{"{\"title\": \"Min Cost Climbing Stairs\", \"url\": \"https://leetcode.com/problems/min-cost-climbing-stairs/\", \"difficulty\": \"easy\"}","{\"title\": \"Fibonacci Number\", \"url\": \"https://leetcode.com/problems/fibonacci-number/\", \"difficulty\": \"easy\"}","{\"title\": \"N-th Tribonacci Number\", \"url\": \"https://leetcode.com/problems/n-th-tribonacci-number/\", \"difficulty\": \"easy\"}","{\"title\": \"Minimum Rounds to Complete All Tasks\", \"url\": \"https://leetcode.com/problems/minimum-rounds-to-complete-all-tasks/\", \"difficulty\": \"medium\"}","{\"title\": \"Count Number of Ways to Place Houses\", \"url\": \"https://leetcode.com/problems/count-number-of-ways-to-place-houses/\", \"difficulty\": \"medium\"}","{\"title\": \"Number of Ways to Reach a Position After Exactly k Steps\", \"url\": \"https://leetcode.com/problems/number-of-ways-to-reach-a-position-after-exactly-k-steps/\", \"difficulty\": \"medium\"}"}', '2022-09-09 16:01:35.48274+08', '2022-09-09 16:01:35.48274+08');
INSERT INTO public."Questions" (id, title, url, difficulty, prompt, examples, constraints, related_topics, similar_questions, "createdAt", "updatedAt") VALUES (14, 'Remove Duplicates from Sorted List', 'https://leetcode.com/problems/remove-duplicates-from-sorted-list', 'easy', 'Given the head of a sorted linked list, delete all duplicates such that each element appears only once. Return the linked list sorted as well. ', '{"Input: head = [1,1,2]
